    public static int lengthOfLongestSubstring(String s) {
        if (s.isEmpty()) return 0;
        char[] chaArr = s.toCharArray();
//        ArrayList<String> temps = new ArrayList<>();
        String mem = String.valueOf(chaArr[0]);

        for (int i = 0; i < chaArr.length; i++) {
            for (int j = i + 1; j < chaArr.length; j++) {
                String memory = "";
                for (int k = i; k <= j; k++) {
                    memory += chaArr[k];
                }
                if (!checkUnique(memory)) break;
                mem = memory.length() > mem.length() ? memory : mem;
//                temps.add(memory);
            }
        }

//        for (int i = 0; i <temps.size() ; i++) {
//            System.out.println(temps.get(i) +" "+ checkUnique(temps.get(i)));
//            mem = checkUnique(temps.get(i)) && temps.get(i).length()>mem.length() ? temps.get(i) : mem;
//
//        }
        System.out.println("Substring: " + mem);
        return mem.length();
    }

    public static boolean checkUnique(String string) {
        char[] chaArr = string.toCharArray();
        for (int i = 0; i < chaArr.length; i++) {
            for (int j = i + 1; j < chaArr.length; j++) {
                if (chaArr[i] == chaArr[j]) return false;
            }
        }
        return true;
    }


